        type: DataTypes.TIME,
        allowNull: true,
    },
    EndTime: {
        type: DataTypes.TIME,
        allowNull: true,
    }
}, {
    sequelize,
    modelName: "DentistSchedule",
    tableName: "DentistSchedule",
    timestamps: false,
});

export default DentistSchedule;

