        type: DataTypes.STRING,
        allowNull: false,
        unique: true,

    },

    AccountID: {
        type: DataTypes.INTEGER,
        allowNull: false,
        references: {
            model: "Account",
            key: "AccountID"
        }
    },
    ClinicID: {
        type: DataTypes.INTEGER,
        allowNull: false,
        references: {
            model: "Clinic",
            key: "ClinicID"
        }
    },
    Description: {
        type: DataTypes.TEXT,
        allowNull: true,
    }

},
    {
        sequelize,
        modelName: "Dentist",
        tableName: "dentist",
        timestamps: false,
    }
);
export default Dentist;

